- {claw}, vuốt (mèo, chim), chân có vuốt, càng (cua...), vật hình móc, (kỹ thuật) cam, vấu, cái kẹp, (thông tục) tay, bớt hăng, bớt sôi nổi; có thái độ ôn hoà hơn, bẻ móng vuốt của ai (bóng), quắp (bằng vuốt), quào, cào; xé (bằng vuốt), gãi, (+ at) móc vào, bám lấy; vồ, chụp bằng móng, (+ off) (hàng hải) ra khơi, ra khỏi bến cảng (thuyền), hãy đề cao tôi, tôi lại đề cao anh
- {talon}, móng, vuốt (chim mồi), gốc (biên lai, séc...), bài chia còn dư
- {hoof}, (động vật học) móng guốc,(đùa cợt) chân người, móng chẻ hai (như của bò, hươu...), còn sống (vật nuôi), (xem) pad, (nghĩa bóng) để lộ bộ mặt thật, để lòi đuôi, dưới sự đè nén áp lực của ai, bị ai chà đạp giày xéo, đá bằng móng, (từ lóng) đá, đá đít (ai), cuốc bộ, (từ Mỹ,nghĩa Mỹ),  (từ lóng) nhảy múa, khiêu vũ

